أخبرنا الله عز وجل عن امرأة سكتت عن الشذوذ، كيف انتهى بها المطاف؟

في الدنيا:
{فَلَمَّا جَآءَ أَمْرُنَا جَعَلْنَا عَٰلِيَهَا سَافِلَهَا وَأَمْطَرْنَا عَلَيْهَا حِجَارَةً مِّن سِجِّيلٍۢ مَّنضُودٍۢ}

في الآخرة:
{وَقِيلَ ٱدْخُلَا ٱلنَّارَ مَعَ ٱلدَّٰخِلِينَ}

